import React from "react";
import { NavLink } from "react-router-dom";

function Home() {
  // const [drinks, setDrinks] = useState([]);

  // useEffect(() => {
  //   fetchSpecificDrinks();
  // }, []);

  // const fetchSpecificDrinks = async () => {
  //   const drinkIds = [11000, 11009, 11470, 11053];
  //   let specificDrinks = [];

  //   for (const drinkId of drinkIds) {
  //     const response = await fetch(`http://localhost:3000/drinks/${drinkId}`);

  //     if (response.ok) {
  //       const specificDrink = await response.json();
  //       specificDrinks.push(specificDrink);
  //     }
  //   }

  //   setDrinks(specificDrinks);
  // };

  return (
    <div>
      <div className="home-page-1-container">
        <img
          id="bartender-image"
          src={process.env.PUBLIC_URL + "/images/homepage/Home2.png"}
          alt="bartender-logo"
        />
        <NavLink to="/drink-search">
          <img
            id="mixing-button-image"
            src={process.env.PUBLIC_URL + "/images/homepage/Home7.png"}
            alt="mixing-button"
          />
        </NavLink>
      </div>
      <div className="home-page-2-container">
        <div className="row-3">
          <div className="column-2">
            <NavLink to="/drink-search">
              <img
                id="cocktail-generator-image"
                src={process.env.PUBLIC_URL + "/images/homepage/Products7.png"}
                alt="mixing-button"
              />
            </NavLink>
          </div>

          <NavLink to="/drink-search">
            <img
              id="coin"
              src={process.env.PUBLIC_URL + "/images/homepage/Products8.png"}
              alt="mixing-button"
            />
          </NavLink>

          <NavLink to="/drink-search">
            <img
              id="browse-by-spirit-image"
              src={process.env.PUBLIC_URL + "/images/homepage/Products9.png"}
              alt="mixing-button"
            />
          </NavLink>
        </div>

        <img
          id="make-my-cocktail-image"
          src={process.env.PUBLIC_URL + "/images/homepage/Products2.png"}
          alt="mixing-button"
        />

        <NavLink to="/drink-search">
          <img
            id="make-my-cocktail-image"
            src={process.env.PUBLIC_URL + "/images/homepage/Products6.png"}
            alt="mixing-button"
          />
        </NavLink>
      </div>
    </div>
  );
}

export default Home;
